	add("stun", "{\"term\":\"stun\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"middle high german (ca. 1050-1500)\", \"middle low german\", \"Icelandic\", \"Dutch\", \"Occitan\", \"Russian\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027stunien\u0027 \u0027stonien\u0027 \u0027stounien\u0027 from Old english (ca. 450-1100) \u0027stunian\u0027 (to crash, make a loud sound, resound, roar, strike with a loud sound, dash, impinge, knock, confound, astonish, stupefy) from Proto-germanic {{m|gem-pro|*stunōną}}, {{m|gem-pro|*stunjaną||to sound, crash, bang, groan}}, from Proto-germanic {{m|gem-pro|*stenaną||to moan, shout}}, from Proto-indo-european {{m|ine-pro|*(s)tona-}}, {{m|ine-pro|*(s)tena-||to thunder, roar, groan}}. Cognate with Middle low german \u0027stonen\u0027 (to groan) Middle high german (ca. 1050-1500) \u0027stunen\u0027 \u0027stunden\u0027 (to drive, push, knock, strike) Swedish \u0027stöna\u0027 (to moan, groan) Russian \u0027стонать, стена́ть\u0027 (to moan, groan) Icelandic \u0027stynja\u0027 (to moan) Related also to Dutch \u0027stenen\u0027 (to groan) German \u0027stöhnen\u0027 (to groan, moan) German \u0027staunen\u0027 (to be astonished, be amazed, marvel at) See also Occitan \u0027estonar\u0027 Old french (842-ca. 1400) \u0027estoner\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being stunned\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The effect on the cue ball where the ball is hit without topspin, backspin or sidespin\", \"priority\":2}]}, \"synonyms\":{}}");

