	add("stupidity", "{\"term\":\"stupidity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027stupiditas\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being stupid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAnd Vickers launched forth into a tirade very different from his platform utterances. He spoke with extreme contempt of the dense \u0027\u0027stupidity\u0027\u0027 exhibited on all occasions by the working classes. He said that if you wanted to do anything for them, you must rule them, not pamper them. Soft heartedness caused more harm than good\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An act that is stupid\", \"priority\":3}]}, \"synonyms\":{}}");

