	add("sturdy", "{\"term\":\"sturdy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Circa 1300, in sense “unruly, reckless, violent”, from Old french (842-ca. 1400) \u0027estourdi\u0027 form of \u0027estourdir\u0027 originally “to daze, to make tipsy (almost drunk)” (Modern French \u0027étourdir\u0027 (to daze, to make tipsy) , from *\u0027\u0027 () Latin etymology is unclear – presumably it is \u0027ex-\u0027 + \u0027turdus\u0027 (thrush (bird)) but which this should mean “daze” is unclear.\u0026lt;ref name\u003d\u0026quot;oetyld\u0026quot;\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; A speculative theory is that thrushes eat leftover winery grapes and thus became drunk, but this meets with objections.\u0026lt;ref\u0026gt;OED\u0026lt;/ref\u0026gt;Disease in cows and sheep is by extension of sense of “daze”, while sense of “strongly built” is of late 14th century,\u0026lt;ref name\u003d\u0026quot;oetyld\u0026quot; /\u0026gt; and relationship to earlier sense is less clear, perhaps from sense of a firm strike (causing a daze) or a strong, violent person.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A disease in sheep and cattle, marked by great nervousness, or by dullness and stupor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sturgeon", "{\"term\":\"sturgeon\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|sturgiun}}, {{m|enm|sturjoun}}, from Anglo-norman {{m|fro|sturjoun}}, Old french (842-ca. 1400) \u0027esturgon\u0027 (sturgeon) from Old Frankish {{m|frk|*sturjō}}, from Proto-germanic {{m|gem-pro|*sturjô||sturgeon}}; see also Old High German \u0027sturio\u0027 (sturgeon) and Old English {{m|ang|styria}}; from Proto-germanic {{m|gem-pro|*sturjô}}; cognate with Russian \u0027осётр\u0027 (sturgeon) Lithuanian {{m|lt|eršketras}}; of obscure origin, but possibly related to the root of stir. Other theories trace it to a lost pre-Indo European language of Scandinavia.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any marine or freshwater fish of the family Acipenseridae that are prized for their roe and are endemic to temperate seas and rivers of the northern hemisphere, especially central Eurasia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, W. N. Holmes, Edward M. Donaldson, \u00271: Body Compartments and the Distribution of Electrolytes\u0027, William Stewart Hoar, David J. Randall (editors), \u0027Fish Physiology\u0027, Volume 1, [http://books.google.com.au/books?id\u003dgi5SR5mK0eAC\u0026amp;pg\u003dPA57\u0026amp;dq\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dh0lqUo-VBIWViQeZvICoDw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;f\u003dfalse page 57\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An investigation has been carried out into the changes in blood chemistry which occur during the migration of young \u0027\u0027sturgeon\u0027\u0027 and spawned adults from freshwater into saltwater and of the migration of prespawning adults in the reverse direction by Magnin (1962\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, M. L. Khrykhtin, V. G. Svirsky, \u0027\u0027\u0027Sturgeon\u0027\u0027 catch and the current status of \u0027\u0027sturgeon\u0027\u0027 stocks in the Amur River\u0027, Andreas Bauer, Astrid Kaiser-Pohlmann, \u0027Sturgeon Stocks and Caviar Trade Workshop: Proceedings\u0027, [http://books.google.com.au/books?id\u003d8g-rfQRqpSYC\u0026amp;pg\u003dPA29\u0026amp;dq\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dET1qUuvdE4nkiALA4oH4CQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;f\u003dfalse page 29\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Strict regulation of the catch was introduced in the Soviet Union in 1976 in order to prevent overfishing of the sexually mature \u0027\u0027sturgeons\u0027\u0027 in the river\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Elizabeth Grossman, \u0027Watershed: The Undamming of America\u0027, [http://books.google.com.au/books?id\u003d9vDGNn1QItkC\u0026amp;pg\u003dPA41\u0026amp;dq\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dh0lqUo-VBIWViQeZvICoDw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;f\u003dfalse page 41\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Long and snout-nosed with rows of platelike bony protrusions, \u0027\u0027sturgeon\u0027\u0027 have a dinosaur-era look\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Richard N. Williams, James A. Lichatowich, Madison S. Powell, \u00274: The Diversity, Structure and Status of Populations\u0027, Richard N. Williams (editor), \u0027Return to the River: Restoring Salmon Back to the Columbia River\u0027, [http://books.google.com.au/books?id\u003d7sYDrB4qH0QC\u0026amp;pg\u003dPA156\u0026amp;dq\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dET1qUuvdE4nkiALA4oH4CQ\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;f\u003dfalse page 156\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Information on the spawning period, spawning behavior, and other details of the reproductive biology of green \u0027\u0027sturgeon\u0027\u0027 in the Columbia River is lacking (Oregon Department of Fish and Wildlife and Washington Department of Fish and Wildlife 1995\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Samuel M. McGinnis, \u0027Field Guide to Freshwater Fishes of California\u0027, Revised Edition, [http://books.google.com.au/books?id\u003dLJPtPhrjow8C\u0026amp;pg\u003dPA139\u0026amp;dq\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dET1qUuvdE4nkiALA4oH4CQ\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;f\u003dfalse page 139\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Only about one out of every 80 \u0027\u0027sturgeons\u0027\u0027 caught in the Sacramento River is a Green \u0027\u0027Sturgeon\u0027\u0027, and that lopsided ratio is reversed for \u0027\u0027sturgeons\u0027\u0027 taken in the Klamath River\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Molly Aloian, \u0027The Yangtze: China\u0027s Majestic River\u0027, [http://books.google.com.au/books?id\u003dTmw-00JaCtMC\u0026amp;pg\u003dPA22\u0026amp;dq\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dh0lqUo-VBIWViQeZvICoDw\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sturgeon%22%7C%22sturgeons%22\u0026amp;f\u003dfalse page 22\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In 2009, 120,000 Chinese \u0027\u0027sturgeons\u0027\u0027 were released into the Yangtze River in an effort to boost the population of the endangered species in the wild\", \"priority\":19}]}, \"synonyms\":{}}");

	add("sturmabteilung", "{\"term\":\"sturmabteilung\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German German|Sturmabteilung\u0027, from {{m|de|Sturm||storm}} + {{m|de|Abteilung||detachment, division}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A paramilitary division under the German Nazi Party, operating from 1921 until being disbanded in 1934. Abbreviated to \u0027\u0027SA\", \"priority\":1}]}, \"synonyms\":{}}");

